    public void updateEvents(Table eventTable, Map<String, Row> currentEventRows, List<FightSchedule> allEvents) throws IOException {
        System.out.println("Adding UFC event data to db");

        for(FightSchedule event : allEvents){
            System.out.println("event " + event.getFmLiveFeed().getEventId());
            //make this a method in a helper class
            Map<String, String> eventDataUpdateMap = basicObjectFactory.createKeyValueMap();
            eventDataUpdateMap.put("Event_Id", event.getFmLiveFeed().getEventId());
            eventDataUpdateMap.put("Event_Time", event.getFmLiveFeed().getEventTime());
            eventDataUpdateMap.put("Event_City", event.getFmLiveFeed().getCity());
            eventDataUpdateMap.put("Event_Country", event.getFmLiveFeed().getCountry());
            eventDataUpdateMap.put("Event_Venue", event.getFmLiveFeed().getVenue());

            Row row = currentEventRows.get(event.getFmLiveFeed().getEventId());
            if(row == null){
                accessDatabaseService.addRowUfcEvent(eventTable, eventDataUpdateMap);
            }
        }
    }

    public void updateFighters(Table fighterTable, Map<String, Row> currentFighterRows, Map<String, FighterInfoData> allFighters) throws IOException {
        System.out.println("Adding UFC fighter data to db");

        for(Map.Entry<String,FighterInfoData> fighter : allFighters.entrySet()){
            System.out.println("fighter " + fighter.getKey());
            //make this a method in a helper class
            Map<String, String> fighterDataUpdateMap = basicObjectFactory.createKeyValueMap();
            fighterDataUpdateMap.put("Fighter_Id", fighter.getValue().getFighterId());
            fighterDataUpdateMap.put("Fighter_Name", fighter.getValue().getFighterName());
            fighterDataUpdateMap.put("Status", fighter.getValue().getStatus());
            fighterDataUpdateMap.put("Age", fighter.getValue().getAge());
            fighterDataUpdateMap.put("Hometown", fighter.getValue().getHometown());
            fighterDataUpdateMap.put("Trains_At", fighter.getValue().getTrainsAt());
            fighterDataUpdateMap.put("Fighting_Style", fighter.getValue().getFightingStyle());
            fighterDataUpdateMap.put("Height", fighter.getValue().getHeight());
            fighterDataUpdateMap.put("Weight", fighter.getValue().getWeight());
            fighterDataUpdateMap.put("Leg_Reach", fighter.getValue().getLegReach());
            fighterDataUpdateMap.put("Reach", fighter.getValue().getReach());

            Row row = currentFighterRows.get(fighter.getKey());
            if(row == null){
                accessDatabaseService.addRowUfcFighter(fighterTable, fighterDataUpdateMap);
            }
        }
    }

